  test.com: [1.1.1.1, 2.2.2.2]


# tls:
  # certificate: string # 
  # private-key: string # 

dns:   
  cache-algorithm: arc
  enable: true
  listen: 0.0.0.0:1053
  use-hosts: true
  ipv6: true
  ipv6-timeout: 300  
  prefer-h3: true  
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  fake-ip-filter:
    - '*'
    - '+.lan'
  nameserver:    
    - tls://223.5.5.5
    - tls://dot.pub
    - tls://[2001:4860:4860::8844]#FINAL
    - tls://[2606:4700:4700::1001]#FINAL
  default-nameserver: 
    - 223.5.5.5
#    - tls://dot.pub
  nameserver-policy:
    "geosite:ir,private":
      - tls://223.5.5.5
      - tls://dot.pub
    "rule-set:ir,private,nsfw1":
      - tls://223.5.5.5
      - tls://dot.pub         
  proxy-server-nameserver:
    - tls://223.5.5.5
    - tls://dot.pub     
  fallback:
    - quic://a.passcloud.xyz:784#FINAL
    - tls://8.8.4.4:853#PROXY


tun:    
  enable: true
  device: utun # gvisor/mixed
  mtu: 9000 
  stack: system 
  dns-hijack:
    - any:53  
    - tcp://any:53
    - 114.114.114.114
    - 180.76.76.76
    - 119.29.29.29
    - 223.5.5.5
    - 8.8.8.8
    - 8.8.4.4
    - 1.1.1.1
    - 1.0.0.1
  auto-route: true 
  auto-detect-interface: true  
  inet4-route-address: 
    - 0.0.0.0/1
    - 128.0.0.0/1
  inet6-route-address: 
    - "::/1"
    - "8000::/1"
  strict-route: true 
  include_android_user:
    - 0
    

sniffer:                
  enable: false                
  force-dns-mapping: false
  parse-pure-ip: false          
  override-destination: false      
  sniff:   
    TLS:
      ports: [443, 8443]
    QUIC:
      ports: [ 443 ]
    HTTP: 
      ports: [80, 8080-8880]
      override-destination: true 
  force-domain:
    - google.com
    - +.v2ex.com
  skip-domain:
    - Mijia Cloud
    - +.apple.com
  sniffing:
    - tls
    - http
  port-whitelist:
    - "80"
    - "443"
  
profile:
  store-selected: true
  store-fake-ip: true
